import React, { Component } from 'react';
import './App.css';
import {Route, Switch, Link } from "react-router-dom";
import {Home} from './Home'

class App extends Component {
  render() {
    return (
      <Switch>
        <Route exact path={'/'} component={Home} />
        <Route component={Home} />

      </Switch>
    );
  }
}

export default App;
